import React from 'react';
import { Link } from 'react-router-dom';
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Typography from '@material-ui/core/Typography'


class Navbar extends React.Component {
    render() {



      return (
        <div>
      <AppBar>
      <Toolbar>
      <Link to="/">Contact</Link>
  <Typography> 00 HOME </Typography>
  <Typography> 01 DESTINATION </Typography>
  <Typography> 02 CREW </Typography>
  <Typography> 03 TECHNOLOGY </Typography>
</Toolbar>
</AppBar>
      <ul>
      <li> <Link to="/">00 HOME</Link></li> 
      <li> <Link to="/Destination">01 DESTINATION</Link></li>
      <li> <Link to="/Crew">02 CREW</Link></li> 
      <li> <Link to="/Technology">03 TECHNOLOGY</Link></li> 
      </ul>
        </div>
      )
    }
  }

export default Navbar;
